You can call functions like this: function_name(positional_args, kwargs) The positional_args is a list of comma-separated args, and kwargs is a list of comma-separated key-value arguments, the key and value being separated by :. Examples: f(a, b, c: d, e: f)
// note that you can also have only positional args or kwargs, without needing the extra comma between them
g(0, a)
h(a: b, c: d) project() You can also have a trailing comma and split function calls over multiple lines: f( 0, 1,
)
g( a: b, c: d,
) Note : newlines are allowed only after commas.
